openapi: 3.0.1
info:
  description: Rest-Interface for ONES
  title: vdd4ones
  version: 1.0a
servers:
- description: Generated server url
  url: https://vdd4ones.de:8080
paths:
  /rest/application/register/account/{accountUuid}:
    get:
      operationId: getAccoundByUuid
      parameters:
      - explode: false
        in: path
        name: accountUuid
        required: true
        schema:
          type: string
        style: simple
      responses:
        "200":
          content:
            '*/*':
              schema:
                $ref: '#/components/schemas/registeredAccount'
          description: OK
      security:
      - basicAuth: []
      tags:
      - application-account-controller
      x-accepts: '*/*'
    put:
      operationId: putRegisterAccount
      parameters:
      - explode: false
        in: path
        name: accountUuid
        required: true
        schema:
          type: string
        style: simple
      requestBody:
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/updateAccount'
        required: true
      responses:
        "200":
          content:
            '*/*':
              schema:
                $ref: '#/components/schemas/registerResponce'
          description: OK
      security:
      - basicAuth: []
      tags:
      - application-account-controller
      x-contentType: application/json
      x-accepts: '*/*'
  /rest/application/register/account/unlock:
    put:
      operationId: putRegisterAccountUnlock
      parameters:
      - explode: true
        in: query
        name: uuid
        required: true
        schema:
          type: string
        style: form
      - explode: true
        in: query
        name: code
        required: true
        schema:
          type: string
        style: form
      responses:
        "200":
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/registerResponce'
          description: OK
      security:
      - basicAuth: []
      tags:
      - application-account-controller
      x-accepts: application/json
  /rest/masterdata/horse/account/{uuid}:
    post:
      operationId: postRegisterHorse
      parameters:
      - explode: false
        in: path
        name: uuid
        required: true
        schema:
          type: string
        style: simple
      requestBody:
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/registerHorse'
        required: true
      responses:
        "200":
          content:
            '*/*':
              schema:
                type: object
          description: OK
      security:
      - basicAuth: []
      tags:
      - masterdata-horse-controller
      x-contentType: application/json
      x-accepts: '*/*'
  /rest/event/nomination/account/{uuid}:
    post:
      operationId: postAccountNomination
      parameters:
      - explode: false
        in: path
        name: uuid
        required: true
        schema:
          type: string
        style: simple
      requestBody:
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/registerNomination'
        required: true
      responses:
        "200":
          content:
            '*/*':
              schema:
                $ref: '#/components/schemas/registerResponce'
          description: OK
      security:
      - basicAuth: []
      tags:
      - event-contest-controller
      x-contentType: application/json
      x-accepts: '*/*'
  /rest/application/register/account:
    post:
      operationId: postRegisterAccount
      requestBody:
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/registerAccount'
        required: true
      responses:
        "200":
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/registerResponce'
          description: OK
      security:
      - basicAuth: []
      tags:
      - application-account-controller
      x-contentType: application/json
      x-accepts: application/json
  /rest/masterdata/property/items/{proptery}:
    get:
      operationId: getPropertyItems
      parameters:
      - explode: false
        in: path
        name: proptery
        required: true
        schema:
          type: string
        style: simple
      responses:
        "200":
          content:
            '*/*':
              schema:
                items:
                  $ref: '#/components/schemas/MasterdataProperty'
                type: array
          description: OK
      security:
      - basicAuth: []
      tags:
      - masterdata-property-controller
      x-accepts: '*/*'
  /rest/event/contests:
    get:
      operationId: getContestByYear
      parameters:
      - explode: true
        in: query
        name: fromDate
        required: false
        schema:
          format: date-time
          type: string
        style: form
      - explode: true
        in: query
        name: untilDate
        required: false
        schema:
          format: date-time
          type: string
        style: form
      - explode: true
        in: query
        name: countryRegions
        required: false
        schema:
          items:
            type: string
          type: array
        style: form
      - explode: true
        in: query
        name: contestKinds
        required: false
        schema:
          items:
            type: string
          type: array
        style: form
      - explode: true
        in: query
        name: isCountryChampionship
        required: false
        schema:
          format: int32
          type: integer
        style: form
      - explode: true
        in: query
        name: isCEI
        required: false
        schema:
          format: int32
          type: integer
        style: form
      - explode: true
        in: query
        name: isCard
        required: false
        schema:
          format: int32
          type: integer
        style: form
      - explode: true
        in: query
        name: onlyRegistered
        required: false
        schema:
          type: boolean
        style: form
      - explode: true
        in: query
        name: accountUuid
        required: false
        schema:
          type: string
        style: form
      - explode: true
        in: query
        name: pageNo
        required: false
        schema:
          default: 0
          format: int32
          type: integer
        style: form
      - explode: true
        in: query
        name: pageSize
        required: false
        schema:
          default: 10
          format: int32
          type: integer
        style: form
      - explode: true
        in: query
        name: sortBy
        required: false
        schema:
          default: beginning
          type: string
        style: form
      responses:
        "200":
          content:
            '*/*':
              schema:
                $ref: '#/components/schemas/ResponcePageContests'
          description: OK
      security:
      - basicAuth: []
      tags:
      - event-contest-controller
      x-accepts: '*/*'
  /rest/event/contest:
    get:
      operationId: getContestByUuid
      parameters:
      - explode: true
        in: query
        name: contestUuid
        required: true
        schema:
          type: string
        style: form
      - explode: true
        in: query
        name: accountUuid
        required: true
        schema:
          type: string
        style: form
      responses:
        "200":
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/EventContest_Plain'
          description: OK
      security:
      - basicAuth: []
      tags:
      - event-contest-controller
      x-accepts: application/json
  /rest/event/contest/result/current:
    get:
      operationId: getCurrentContestCompetitionsResults
      responses:
        "200":
          content:
            '*/*':
